import React from 'react';
import { useDispatch } from 'react-redux';
import { Input } from 'semantic-ui-react';
import { searchAllGigs } from '../../../redux/actions/guest/gigAction';
const SearchGigsInput = (props) => {
	const dispatch = useDispatch();
	const onEnter = (e) => {
		if (e.charCode === 13) {
			dispatch(searchAllGigs(e.target.value));
		}
	};
	return (
		<>
			<Input fluid icon="search" placeholder="Search Gigs..." onKeyPress={onEnter} />
		</>
	);
};

SearchGigsInput.propTypes = {};

export default SearchGigsInput;
